var React = require('react');
var Default = require('./default');

class Home extends React.Component {
    render() {

        let users = this.props.users.map( (user, index) => { return (
            <p className="pt-5"> <a href={user.name} className="name pt-5">{user.name}</a><p className="opacity">{user.category} <br/><strong>Likes:</strong> {user.likes} <br/><strong>By: </strong>{user.deadline}</p></p>

            );
        });

        return (
            <html>
                <head>
                    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css" integrity="sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm" crossOrigin="anonymous"/>
